import { Link } from "react-router-dom";

export default function LoginPage() {
  return (
    // Use 'flex flex-col' for a column layout and centering items horizontally
    // Use 'items-center justify-center' to center items horizontally and vertically in the flex container
    // 'min-h-screen' ensures the div takes at least the height of the screen
    // 'bg-gray-100' applies a background color
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      {/* Additional items can be added here and they will also be centered */}
      <input
        type="email"
        placeholder="Your Email"
        // 'm-4' adds margin for spacing between this input and any other items you might add
        // 'border-2 border-gray-300 bg-white h-10 px-5 rounded-lg text-sm focus:outline-none' styles the input
        className="m-4 border-2 border-gray-300 bg-white h-10 px-5 rounded-lg text-sm focus:outline-none"
      />
      {/* You can add more elements here and they will be centered vertically in the column */}
    </div>
  );
}
